  bookcard: {
    width: "284px",
    height: "466px",
    ledt: "20px",
    right: "50px",
  },
});
interface Props {
  startIcon?: any;
  variant?: any;
  color?: any;
  children?: any;
  disabled?: boolean;
}

const BookCard: React.FunctionComponent = () => {
  const classes = useStyles();
  return <Container className={classes.bookcard}>BookCard </Container>;
};

export default BookCard;
